import React from 'react'
import "./Footer.css";

const Footer = () => {
  return (
    <div>
    <div className="footer-section">
      <div className="footer-container"></div>
      <div className="footer-text-container">
        <h1 className="footer-title"></h1>
      </div>
    </div>
  </div>
  )
}

export default Footer
